class Solution {
public:
    int maxOperations(string s) {
        vector<int> pos;
        for(int i=0;i<s.size();i++) if(s[i]=='1') pos.push_back(i);
        int ans = 0;
        int cnt = 0;
        for(int i=0;i<s.size();i++){
            if(i &&  s[i]=='1'&& s[i-1]=='0') ans += cnt;
            if(s[i]=='1') cnt++;
            // cout << i << " " << ans << endl;
        }
        if(s[s.size()-1]=='0') ans += cnt;
        return ans;
    }
};
